import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [parts, setParts] = useState([]);
  const [form, setForm] = useState({
    name: '',
    category: '',
    supplier: '',
    quantity: 0,
    price: 0,
  });
  const [filter, setFilter] = useState('');

  useEffect(() => {
    fetchParts();
  }, []);

  const fetchParts = async () => {
    try {
      const res = await axios.get(`/api/parts${filter ? `?name=${filter}` : ''}`);
      setParts(res.data);
    } catch (err) {
      console.error('Failed to fetch parts:', err);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('/api/parts', form);
      setForm({ name: '', category: '', supplier: '', quantity: 0, price: 0 });
      fetchParts();
    } catch (err) {
      console.error('Failed to add part:', err);
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`/api/parts/${id}`);
      fetchParts();
    } catch (err) {
      console.error('Failed to delete part:', err);
    }
  };

  return (
    <div className="p-4 max-w-4xl mx-auto">
      <h1 className="text-2xl font-bold mb-4">Parts Inventory Manager</h1>

      <input
        type="text"
        placeholder="Filter by name..."
        value={filter}
        onChange={(e) => setFilter(e.target.value)}
        onBlur={fetchParts}
        className="border p-2 mb-4 w-full"
      />

      <form onSubmit={handleSubmit} className="mb-4 grid gap-2 grid-cols-2 sm:grid-cols-3">
        <input name="name" value={form.name} onChange={handleChange} placeholder="Name" required className="border p-2" />
        <input name="category" value={form.category} onChange={handleChange} placeholder="Category" required className="border p-2" />
        <input name="supplier" value={form.supplier} onChange={handleChange} placeholder="Supplier" required className="border p-2" />
        <input type="number" name="quantity" value={form.quantity} onChange={handleChange} placeholder="Quantity" required className="border p-2" />
        <input type="number" step="0.01" name="price" value={form.price} onChange={handleChange} placeholder="Price" required className="border p-2" />
        <button type="submit" className="bg-blue-600 text-white p-2 col-span-full sm:col-span-1">Add Part</button>
      </form>

      <table className="table-auto w-full border">
        <thead>
          <tr className="bg-gray-200">
            <th>Name</th>
            <th>Category</th>
            <th>Supplier</th>
            <th>Qty</th>
            <th>Price</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {parts.map((part) => (
            <tr key={part.id}>
              <td>{part.name}</td>
              <td>{part.category}</td>
              <td>{part.supplier}</td>
              <td>{part.quantity}</td>
              <td>${part.price}</td>
              <td>
                <button onClick={() => handleDelete(part.id)} className="text-red-600">Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
